import React, { useState } from 'react';

import regions from './regions.json';
import './App.css';
import MatchHistory from './Components/MatchHistory/MatchHistory';
import PlayerProfile from './Components/PlayerProfile/PlayerProfile';
import Navbar from './Components/Navbar/Navbar';
import LoadingCircle from './Components/LoadingCircle/LoadingCircle';

// TODO: circle spin when loading

function App() {
  const [matchHistory, setMatchHistory] = useState([]);
  const [playerData, setPlayerData] = useState({});
  const [rankedData, setRankedData] = useState([]);
  const [summData, setSummData] = useState([]);
  const [runeData, setRuneData] = useState([]);
  const [loadingMatchHistory, setLoadingMatchHistory] = useState(true);
  const [loadingRankedData, setLoadingRankedData] = useState(true);
  const [loadingPlayerData, setLoadingPlayerData] = useState(true);
  const [loadingSummData, setLoadingSummData] = useState(true);
  const [loadingRuneData, setLoadingRuneData] = useState(true);

  const handleMatchHistory = (data) => {
    setMatchHistory(data);
  }
  const handlePlayerData = (data) => {
    setPlayerData(data);
  }
  const handleRankedData = (data) => {
    setRankedData(data);
  }
  const handleSummData = (data) => {
    setSummData(data);
  }
  const handleRuneData = (data) => {
    setRuneData(data);
  }
  const handleLoadMH = (data) => {
    setLoadingMatchHistory(data);
    console.log(loadingMatchHistory);
  }
  const handleLoadPD = (data) => {
    setLoadingPlayerData(data);
  }
  const handleLoadRD = (data) => {
    setLoadingRankedData(data);
  }
  const handleLoadSD = (data) => {
    setLoadingSummData(data);
  }
  const handleLoadRUD = (data) => {
    setLoadingRuneData(data);
  }
  
  return (
    <div className="App">
      <Navbar onPlayerData={handlePlayerData} onMatchHistory={handleMatchHistory}
      onRankedData={handleRankedData} onSummData={handleSummData} onRuneData={handleRuneData}
      onLoadingMH={handleLoadMH} onLoadingPD={handleLoadPD} onLoadingRD={handleLoadRD}
      onLoadingSD={handleLoadSD} onLoadingRUD={handleLoadRUD} regions={regions} />
      {loadingMatchHistory && loadingPlayerData && loadingRankedData && loadingSummData && loadingRuneData ? <LoadingCircle /> : 
      JSON.stringify(playerData) !== '{}' && JSON.stringify(playerData) !== undefined ? 
        <div className="container">
          {/* PROFILE DETAILS */}
          <PlayerProfile playerData={playerData} rankedData={rankedData} />
          {/* MATCH HISTORY */}
          <MatchHistory matchHistory={matchHistory} playerData={playerData} summData={summData} runeData={runeData} />
        </div>
      : 
        <div className="no-player">
          <p>404</p>
          <p>Player not found. :(</p>
        </div>
      }
    </div>
  );
}

export default App;
